css:
@-moz-document domain(surviv.io)
{

  #background
  {
    background-image: url(https://media4.giphy.com/media/beQbOW20efUiU0TS6P/giphy.gif?cid=790b7611a3a48e3c518a01e453db530cd83341f9678c4ad2&rid=giphy.gif&ct=g) !important;
  }

  #start-row-header
  {
    background-image: url(https://upload.wikimedia.org/wikipedia/commons/7/7f/Surviv.io.png) !important;
  }

  #start-top-left
  {
    visibility: visible !important;
  }

  #featured-streamers
  {
    visibility: visible !important;
  }

  #start-bottom-left
  {
    visibility: visible !important;
  }

  #start-bottom-middle
  {
    visibility: visible !important;
  }

  .menu-option
  {
    border-radius: 0px !important;
    border-color: #000000 !important;
  }

  .btn-green
  {
    border-bottom: 0px !important;
    background: #f2d61f !important;
    color: #000000 !important;
    box-shadow: inset 0 -2px #202020;
  }

  .btn-team-option
  {
    border-bottom: 0px !important;
    background: #f2d61f  !important;
    color: #000000 !important;
    box-shadow: inset 0 -2px #202020;
  }

  .account-details-button-wrapper
  {
    border-bottom: 0px !important;
    background: #f2d61f  !important;
    color: #000000 !important;
    box-shadow: inset 0 -2px #202020 !important;
  }

  #btn-pass-locked
  {
    border-bottom: 0px !important;
    background: #f2d61f  !important;
    color: #000000 !important;
    box-shadow: inset 0 -2px #202020;
  }

  #btn-customize
  {
    border-bottom: 0px !important;
    background: #f2d61f  !important;
    background-image: url(http://surviv.io/img/emotes/surviv.svg) !important;
    background-position: 8px 5px !important;
    background-repeat: no-repeat !important;
    background-size: 28px !important;
    color: #000000 !important;
    box-shadow: inset 0 -2px #202020;
  }

  #btn-help
  {
    border-bottom: 0px !important;
  }
}
